using System.Net;
using System.Reflection;

namespace Uccs.Rdn
{
	public abstract class Rdn : McvNet
	{
		public override	string				Name => "Rdn" + Scope.ToString();
		public override ushort				BasePort => 020;
 		
		public bool							Auctions				= false;
		public long							DomainRankCheckECFee	= 5;

 		public static readonly Rdn			Local = new RdnLocalNet();
 		public static readonly Rdn			Test = new RdnTestNet();
 		public static readonly Rdn			Developer0 = new RdnDeveloper0Net();
		public static readonly Rdn			Main = null;
		public static readonly Rdn[]		Official = [Local, Developer0, Test];

		public static Rdn					ByName(string name) => Official.First(i => i.Name == name);
		public static Rdn					ById(Guid id) => Official.First(i => i.Id == id);
		
		public Rdn()
		{
		}

		public override string ToString()
		{
			return Name;
		}

		static Rdn()
		{
			if(!ITypeCode.Contructors.ContainsKey(typeof(PeerRequest)))
				ITypeCode.Contructors[typeof(PeerRequest)] = [];

			foreach(var i in Assembly.GetExecutingAssembly().DefinedTypes.Where(i => i.IsSubclassOf(typeof(PeerRequest)) && !i.IsGenericType))
			{	
				var c = Enum.Parse<RdnPeerCallClass>(i.Name.Remove(i.Name.IndexOf("Request")));
				
				ITypeCode.Codes[i] = (byte)c;
				ITypeCode.Contructors[typeof(PeerRequest)][(byte)c]  = i.GetConstructor([]);
			}

			if(!ITypeCode.Contructors.ContainsKey(typeof(PeerResponse)))
				ITypeCode.Contructors[typeof(PeerResponse)] = [];

			foreach(var i in Assembly.GetExecutingAssembly().DefinedTypes.Where(i => i.IsSubclassOf(typeof(PeerResponse))))
			{	
				var c = Enum.Parse<RdnPeerCallClass>(i.Name.Remove(i.Name.IndexOf("Response")));

				ITypeCode.Codes[i] = (byte)c;
				ITypeCode.Contructors[typeof(PeerResponse)][(byte)c]  = i.GetConstructor([]);
			}

			ITypeCode.Contructors[typeof(Urr)] = [];

			foreach(var i in Assembly.GetExecutingAssembly().DefinedTypes.Where(i => i.IsSubclassOf(typeof(Urr)) && !i.IsAbstract))
			{
				ITypeCode.Codes[i] = (byte)Enum.Parse<UrrScheme>(i.Name);
				ITypeCode.Contructors[typeof(Urr)][(byte)Enum.Parse<UrrScheme>(i.Name)] = i.GetConstructor([]);
			}

			if(!ITypeCode.Contructors.ContainsKey(typeof(NetException)))
				ITypeCode.Contructors[typeof(NetException)] = [];

			ITypeCode.Codes[typeof(ResourceException)] = (byte)ExceptionClass._Next;
			ITypeCode.Contructors[typeof(NetException)][(byte)ExceptionClass._Next] = typeof(ResourceException).GetConstructor([]);

		}
	}

	public class RdnLocalNet : Rdn
	{	
		public override	NetScope	Scope => NetScope.Local;
		
		public RdnLocalNet()
		{
			Id				= new Guid("FFFFFFFF-1002-0000-0000-000000000000");
			Genesis			= "";
			Father0IP		= new IPAddress(new byte[] {127, 0, 0, 100});
			Cryptography	= Cryptography.No;
			PoW				= false;
			Auctions		= true;
			CommitLength	= 100;
			ECLifetime		= Time.FromYears(100);

			Initials		= Enumerable.Range(100, 16).Select(i => new IPAddress(new byte[] {127, 0, 0, (byte)i})).ToArray();
		}
	}

	public class RdnDeveloper0Net : Rdn
	{
		public override	NetScope	Scope => NetScope.Developer0;
	
		public RdnDeveloper0Net()
		{
			Id			= new Guid("FFFFFFFF-2002-0000-0000-000000000000");
 			Genesis		= "";

			var z = Test;

 			Father0IP	= z.Father0IP;
			Initials	= z.Initials;
		}
	}

	public class RdnTestNet : Rdn
	{
		public override	NetScope	Scope => NetScope.PublicTest;
	
		public RdnTestNet()
		{
			Id			= new Guid("30020000-0000-0000-0000-000000000000");
 			Genesis		= "";
 			Father0IP	= IPAddress.Parse("78.47.204.100");
			Initials	= UOInitials;
		}
	}

}
